import React, {Component} from 'react';
import {connect} from 'react-redux';

import './ProfileCard.css';
import Stat from './Stat/Stat';

class ProfileCard extends Component {
   render() {
      return (
         <div className="ProfileCard">

            <div className="AvatarHolder">
               <div className="Transformable">
               </div>
               <div className="Avatar">
                  <img src="https://image.freepik.com/free-icon/male-profile-user-shadow_318-40244.jpg" alt="Avatar for user profile"/>
               </div>
            </div>
            <div className="Intro">Sammelan Yogi</div>
            <div className="StatHolder">
               <Stat name="Total Ratings done" value="13"/>
               <Stat name="Average Rating done" value="3.7"/>
            </div>
         </div>
      );
   }
}

function mapStateToProps(state) {
   return {};
}

export default connect(
   mapStateToProps,
)(ProfileCard);
